import {apiPost} from "./base";
import {useQuery} from "@tanstack/react-query";
import * as SecureStore from 'expo-secure-store';

export const useGetMalls = () => {
    return useQuery(
        ['getMalls'],
        async () => await apiPost('/mall'),
    )
}
